 @Anderson_Linhares  Mas o elenco do Palmeiras não é ruim. Precisa apenas de uns três reforços,   porque o defesa Luan, o lateral Marcos e os meias de armação não agradam a torcida, mas mesmo no ataque temos o Adriano que é muito bom, porém a família dele quer que ele jogue no inter, o cara se divorciou e tudo isso fez o rendimento dele baixar bastante, mas temos esse time aqui, e é um time para ficar ali sim, disputando com o galo e o fla: 
o melhor goleiro, o melhor defesa Gustavo Gomes, (Luan), Marcos Rocha ou o Menino, o PK e o Danilo, Renan ou piquerez, Veiga, Dudu, Ronny e "Adriano". E ainda tem o Veron, Scarpa, Zé Rafael, Willian e Wesley... 
Esse time pode jogar, sim, com flamengo e galo e vencer, não é favorito, mas tem um bom técnico e já se mostrou muito competitivo e não vai parar por aí, acreditamos que futuramente chegarão bons reforços.

